import SearchBar from "../components/search/SearchBar";
import styled from "../views/Form.module.css";

const Form = () => {
  return (
    <div>
      
      <form style={{ color: "green" }} className={styled.formP}>
        <div className={styled.fgmail}>
          <label htmlFor="">Gmail:</label>
          <input
            type="email"
            name="gmail"
            //   value={};
          />
        </div>

        <div className={styled.fusername}>
          <label htmlFor="">Username:</label>
          <input
            type="text"
            name="username"
            //   value={}
          />
        </div>

        <div className={styled.fpassword}>
          <label htmlFor="">Password:</label>
          <input
            type="Text"
            name="password"
            //   value={}
          />
        </div>

        <button className={styled.fButton} type="submit">
          Login
        </button>
      </form>
    </div>
  );
};

export default Form;
